import { useState } from 'react'

const Tasks = () => {
    const [tasks, setTasks] = useState([
        {
            id: 1,
            text: "Task 1",
            day: "Day 1",
            reminder: false,
        },
        {
            id: 2,
            text: "Task 2",
            day: "Day 2",
            reminder: false,
        },
    ])


    return (
        <>
            {tasks.map((task) => (
                <h3 key={task.id}>{task.text}</h3>
            ))}
        </>
    )
}

export default Tasks
